import React from 'react'

const Top10 = ({playlist}) => {

    const individualTop10item = playlist.track.map( (songObj, i) => {
        return(
            <Top10Item rank={i} songName={songObj.name} songArtist={songObj.artists}>
            </Top10Item>
        )
    })

    return(
        <div>
            <Top10Item />
        </div>
    )
}

export default Top10


const cards = comments.map( (commentObj, i) => {
    return( 
      <CommentCard key={i}
        imageUrl={commentObj.imageUrl}
        userName={commentObj.userName} 
        datePosted={commentObj.datePosted} >
          {commentObj.comment}
      </CommentCard>
    )
  } );
